import React, { useState, useEffect } from "react";
import { isRequired, isEmailValid } from "../utils/validation";

const UserForm = ({ initialData, onSubmit }) => {
  const [formData, setFormData] = useState({
    firstName: "",
    lastName: "",
    email: "",
    department: "",
  });

  const [errors, setErrors] = useState({});

  useEffect(() => {
    if (initialData) {
      setFormData(initialData);
    }
  }, [initialData]);

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const validate = () => {
    const errs = {};
    if (!isRequired(formData.firstName)) errs.firstName = "First Name is required";
    if (!isRequired(formData.lastName)) errs.lastName = "Last Name is required";
    if (!isRequired(formData.email)) errs.email = "Email is required";
    else if (!isEmailValid(formData.email)) errs.email = "Invalid email format";
    return errs;
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    const errs = validate();
    if (Object.keys(errs).length > 0) {
      setErrors(errs);
      return;
    }
    onSubmit(formData);
  };

  return (
    <form onSubmit={handleSubmit}>
      <div className="mb-2">
        <label>First Name</label>
        <input
          type="text"
          className={`form-control ${errors.firstName ? "is-invalid" : ""}`}
          name="firstName"
          value={formData.firstName}
          onChange={handleChange}
        />
        <div className="invalid-feedback">{errors.firstName}</div>
      </div>
      <div className="mb-2">
        <label>Last Name</label>
        <input
          type="text"
          className={`form-control ${errors.lastName ? "is-invalid" : ""}`}
          name="lastName"
          value={formData.lastName}
          onChange={handleChange}
        />
        <div className="invalid-feedback">{errors.lastName}</div>
      </div>
      <div className="mb-2">
        <label>Email</label>
        <input
          type="email"
          className={`form-control ${errors.email ? "is-invalid" : ""}`}
          name="email"
          value={formData.email}
          onChange={handleChange}
        />
        <div className="invalid-feedback">{errors.email}</div>
      </div>
      <div className="mb-2">
        <label>Department</label>
        <input
          type="text"
          className="form-control"
          name="department"
          value={formData.department}
          onChange={handleChange}
        />
      </div>
      <button type="submit" className="btn btn-success mt-2">
        Submit
      </button>
    </form>
  );
};

export default UserForm;



